            this.ssPrint1_Sheet1.Cells.Get(19, 1).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(19, 2).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(20, 0).StyleName = "Text3778636373733698783800";
            this.ssPrint1_Sheet1.Cells.Get(20, 0).Value = "2) 가운";
            this.ssPrint1_Sheet1.Cells.Get(20, 1).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(20, 2).StyleName = "Text1887636373733698133762";
