            this.ssPrint1_Sheet1.Cells.Get(21, 0).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(21, 0).Value = "환자나 환자의 환경과 접촉이 예상될 때 (환자가 실금하는 경우, 장루나 배액관을 가지고 있는 경우)에는";
            this.ssPrint1_Sheet1.Cells.Get(21, 1).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(21, 2).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(22, 0).ColumnSpan = 3;
            this.ssPrint1_Sheet1.Cells.Get(22, 0).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(22, 0).Value = "반드시 가운을 착용합니다.";
            this.ssPrint1_Sheet1.Cells.Get(22, 1).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(22, 2).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(23, 0).StyleName = "Text3778636373733698783800";
            this.ssPrint1_Sheet1.Cells.Get(23, 0).Value = "3) 손씻기";
            this.ssPrint1_Sheet1.Cells.Get(23, 1).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(23, 2).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(24, 0).ColumnSpan = 3;
            this.ssPrint1_Sheet1.Cells.Get(24, 0).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(24, 0).Value = "환자와 접촉한 전·후에는 반드시 소독제가 포함된 비누나 손소독제를 이용하여 손을 씻습니다.";
            this.ssPrint1_Sheet1.Cells.Get(24, 1).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(24, 2).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(25, 0).ColumnSpan = 3;
            this.ssPrint1_Sheet1.Cells.Get(25, 0).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(25, 0).Value = "장갑이나 가운을 벗은 후에도 반드시 손을 씻어야 합니다.";
