            this.ssPrint1_Sheet1.Cells.Get(26, 2).StyleName = "Text1887636373733698133762";
            this.ssPrint1_Sheet1.Cells.Get(27, 0).StyleName = "Text3778636373733698783800";
            this.ssPrint1_Sheet1.Cells.Get(27, 0).Value = "4) 기타물품 사용";
